import React from 'react';

const Card = (props) =>{
	const {name, username, email, id } = props;
	return(
			<div class = 'tc bg-light-green dib br3 pa3 ma2 grow bw2 shadow-5'>
			  <img src ={`https://robohash.org/${id}?size=200x200`} alt = 'robots'/>
			  <div>
			    <h1>{name}</h1>
			    <h1>{username}</h1>
			    <p>{email}</p>
			  </div>
			</div>
		);
}

export default Card;
